int
init_kor(int lgno) {

    register int  i;
    unsigned long cid;

    if (kor_MAX_TRIGs) {
        languages[lgno].dict = make_dict(2 * kor_MAX_TRIGs, 0);
        languages[lgno].hash = (double *)malloc(sizeof(double) * kor_MAX_TRIGs);
        if (!languages[lgno].hash) return(1);
        for (i = 0; i < kor_MAX_TRIGs; i++) {
           cid = string2id((char *)kor_hash[i].trig, languages[lgno].dict, insert_copy);
           if (cid == ~0) return(1);
           languages[lgno].hash[cid] = kor_hash[i].prob;
        }
        languages[lgno].wdict = (dict_t *)NULL;
        languages[lgno].whash = (double *)NULL;
    } else languages[lgno].used = 0;

    return(0);
}
